import Cities from './cities.json';
import './style.css';
import './style1.css';

function Table() {

    return(
<div>
    <table id="table" >
        <tr>
    <td  >المدن</td>
    <td >عدد السكان</td>
        </tr>
{Cities.map(function data(d) {
    return(

        <tr key={d.id} >
            <td >{d.citie}</td>
            <td >{d.peples}</td>
            <td>
            <button > تعديل   </button> 
            <button onClick={delet(this)}> حدف  </button> 
            </td>

        </tr>
            )   
        })}
    </table>
    {function delet(dt) {
    
    dt.parentElement.parentElement.remove();
    


}}
</div>
    )
    
}
function delet(dt) {
    
        dt.parentElement.parentElement.remove();
        

    
}
export default Table;
